import Stack from '@mui/material/Stack'
import Button from '@mui/material/Button'

function LinkAuth (params) {
  return (
    <>
      <div>
        <a onClick={params.onClick} href='#'>
          {
        isResgister
          ? "J'ai déjà un compte"
          : "Je n'ai pas de compte"
      }
        </a>
      </div>
    </>
  )
}

export default LinkAuth
